ONE LIVE - IN STOCKHOLM is the first live CD &amp; DVD released by W.E.T. on Frontiers Records and will be available in February 2014. The show was filmed and recorded on the 17th of January 2013 at the Debaser Club in Stockholm, Sweden and features performances of songs from the debut album, the sophomore release RISE UP and songs from the band Talisman, Eclipse and Work of Art. The live show will be packaged as a digipak which will contain both the CD and the DVD version which will both contain bonus content including 2 unreleased studio tracks from the RISE UP sessions on the CD and music videos for the singles 'Learn to Live Again' and 'Love Heals' on the DVD

